import React from 'react';
import EventCard from './EventCard';

const HomePage = ({ events }) => {
  return (
    <div className="grid grid-cols-1 md:grid-cols-3 gap-4">
      {events.map((event) => (
        <EventCard key={event.id} event={event} />
      ))}
    </div>
  );
};

export default HomePage;
